- input: "TEXT\x1CC00028860\x1C.TEXT\x1C\x1CF3XA\x1CI am getting warning messages
    on validation that none of the FEC committee ID numbers are in FEC File. However,
    I doubled checked and they are all in there. Because the system is not recognizing
    the committee ID's, it is also not printing the 'Office Sought' information on
    Schedule B. I have made several calls to tech support regarding this issue. I
    left voicemails on January 30 and January 31st but no one has returned my call.
    \                                                                                                                                                                                                                                                  **
    This filing is being amended in response to the commission's notice dated May
    2, 2008. States where independent expenditures were made are identified in the
    'purpose of expenditure' data field on schedules D and E. FECfile software would
    not accept State information in any other data field."
